import React, { useEffect, useState } from 'react'
import "./SearchBar.css";
import SearchIcon from '@mui/icons-material/Search';
import axios from 'axios';

function SearchStudent({ placeholder, data }) {
    const [search, setSearch] = useState(false);
    const [studentName, setStudentName] = useState("");
    const onChange = (e) => {
        setStudentName(e.target.value)
    }

    useEffect(()=>{
        axios
        .get("http://localhost:3300/students")
        .then((response)=>{
            setStudentName(response.data);
        })
        .catch((err)=>{
            console.log(err);
        })
    },[])
    // onChangeSearch = (e) => {
    //     setStudentName(...studentName, [e.target.value])
    // }
    console.log(studentName)
    return (
        <div className='search'>
            <div className='searchInputs'>
                <input type="text" placeholder={placeholder} value={studentName} onChange={onChange} />
                <div className='searchIcon'>
                    <SearchIcon />
                </div>
            </div>
            <div className='dataResult'>
                <table>
                    <tbody>
                        <tr>
                            <th>Id</th>
                            <th>FirstName</th>
                            <th>LastName</th>
                            <th>PhoneNumber</th>
                            <th>Zip</th>
                            <th>StateCode</th>
                            <th>StateName</th>
                        </tr>
                        {}
                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default SearchStudent
